import Task from "./Task";
import TaskColumn from "./TaskColumn";
import { PrimaryButton, svgIconStyle, BodyContainer, TaskGroup, TaskItem } from "./Utility";

function ContentBody() {
    return (
    <div  style={{width:"100%"}}>
    <BodyContainer>
        <TaskColumn props={"academics"}/>
        <TaskGroup style={{flex: '0 0 35%'}}>
          <h3>Tasks</h3>
          <TaskItem>
              <p style={{color:"blue", fontSize:"60px", fontWeight:"800", margin:"8px"}}>95.34%</p>
              <p style={{color:"black", fontSize:"20px", fontWeight:"400",alignSelf :"center"}}>Task completion rate</p>
          </TaskItem>
        </TaskGroup>
    </BodyContainer>
    </div>
  );
}

export default ContentBody;
